import DataView from "../GenericComponent/Dataview"
import { View } from "react-native-web"

export const Users = () => {
    const queryKey = [users]
    const queryFunction = async () => {
        return await endpoints.Users.getAll()
    }
    return (
        <DataView
            queryFunction={queryFunction}
